import React, { Component } from "react";
import Task from "./task";

class Tasks extends Component {
  render() {
    return (
      <div className="tasks">
        {this.props.todos.map(task => (
          <Task task={task.task} onDelete={this.props.onDelete} />
        ))}
      </div>
    );
  }
}

export default Tasks;
